import React from 'react'
import SideData from '../../JSON/side-video-data.json'
import './SideVideo.scss'

function SideVideo({sideData}){
    return (
      <div>
        <h4>NEXT VIDEO</h4>
        {sideData.map(item =>{
          return (
            <div key={item.id} className="up-next">
              <div className="up-next__img-container">
                <img src={process.env.PUBLIC_URL + item.image} alt="" className="up-next__img"/>
              </div>
              <h3>{item.title}</h3>
              <p>{item.channel}</p>
            </div>
            )
        })}
      </div>
    )
}

export default SideVideo
